import React, { useState } from 'react';
import axios from 'axios';
import { useSpring, animated } from 'react-spring';
import './App.css'; // Ensure Tailwind CSS is imported

function App() {
  const [name, setName] = useState('');
  const [phone, setPhone] = useState('');
  const [response, setResponse] = useState('');

  // Animation hooks
  const formAnimation = useSpring({
    opacity: 1,
    transform: 'translateY(0)',
    from: { opacity: 0, transform: 'translateY(-30px)' },
  });

  const responseAnimation = useSpring({
    opacity: response ? 1 : 0,
    transform: response ? 'translateY(0)' : 'translateY(30px)',
    from: { opacity: 0, transform: 'translateY(30px)' },
  });

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = { name, phone };

    try {
      const res = await axios.post('http://localhost:5000/call', data);
      setResponse(res.data.message);
    } catch (error) {
      setResponse('Error making the call');
    }
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Header */}
      <header className="bg-blue-600 text-white py-4">
        <div className="container mx-auto flex justify-between items-center">
          <div className="text-2xl font-bold">VoiceOps</div>
          <nav>
            <ul className="flex space-x-6">
              <li><a href="#home" className="hover:text-gray-300">Home</a></li>
              <li><a href="#services" className="hover:text-gray-300">Services</a></li>
              <li><a href="#about" className="hover:text-gray-300">About Us</a></li>
              <li><a href="#contact" className="hover:text-gray-300">Contact</a></li>
            </ul>
          </nav>
          <button className="bg-white text-blue-600 px-4 py-2 rounded-md hover:bg-gray-200">
            Get Started
          </button>
        </div>
      </header>

      {/* Hero Section */}
      <section id="home" className="relative w-full h-96 bg-cover bg-center" style={{ backgroundImage: 'url(https://via.placeholder.com/1500x500)' }}>
        <div className="absolute inset-0 bg-black opacity-50"></div>
        <div className="relative z-10 text-center text-white flex flex-col justify-center items-center h-full">
          <h1 className="text-4xl font-semibold">Empowering Your Loan Journey with VoiceOps</h1>
          <p className="mt-4 text-lg">Seamless voice interactions for pre and post-loan services.</p>
        </div>
      </section>

      {/* Main Content */}
      <div className="container mx-auto py-12">
        <animated.div style={formAnimation} className="bg-white p-8 rounded-lg shadow-lg max-w-md mx-auto">
          <h2 className="text-2xl font-bold text-center mb-6">Request a Call</h2>
          <form onSubmit={handleSubmit} className="space-y-4">
            <div>
              <label className="block text-sm font-semibold mb-2">Name</label>
              <input
                type="text"
                value={name}
                onChange={(e) => setName(e.target.value)}
                required
                className="w-full p-3 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              />
            </div>
            <div>
              <label className="block text-sm font-semibold mb-2">Phone Number</label>
              <input
                type="text"
                value={phone}
                onChange={(e) => setPhone(e.target.value)}
                required
                className="w-full p-3 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              />
            </div>
            <button
              type="submit"
              className="w-full bg-blue-600 text-white py-3 rounded-md hover:bg-blue-700 transition"
            >
              Make the Call
            </button>
          </form>
          <animated.p style={responseAnimation} className="mt-4 text-center text-lg font-semibold text-gray-800">
            {response}
          </animated.p>
        </animated.div>
      </div>

      {/* Footer */}
      <footer className="bg-blue-600 text-white py-6">
        <div className="container mx-auto text-center">
          <p>&copy; 2025 VoiceOps. All Rights Reserved.</p>
          <p>Contact Us: <a href="mailto:support@voiceops.com" className="underline">support@voiceops.com</a></p>
          <div className="mt-4">
            <a href="#" className="text-white mx-2 hover:text-gray-300">Facebook</a>
            <a href="#" className="text-white mx-2 hover:text-gray-300">Twitter</a>
            <a href="#" className="text-white mx-2 hover:text-gray-300">LinkedIn</a>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default App;
